import React from "react";
import { Col } from "react-bootstrap";
import styles from './SideBar.module.css'

function SideBar(){
    return(
        <Col lg={3} md={4} className={`${styles['column-main']}`}>
            Ciao
        </Col>
    )
}

export default SideBar
